{
  "name": "Av. Corrientes al 4553",
  "address": "Av. Corrientes al 4553",
  "description": [
        "Excelente Casa de 7 ambientes sobre lote propio de 190 m2 aproximadamente (8,66 x 21.5), desarrollada en 2 plantas, balcón, jardín con patio, terraza con parrilla y patio de invierno. Muy buena ubicación, en uno de los barrios más tranquilos de la Ciudad. Superficie Cubierta: 150 m2 Descubierta 100 m2 Total 250m2",
        "En Planta Baja, 4 amplios ambientes/oficinas/despachos/consultorios (uno de ellos con baño en suite y jacuzzi) con amplios placares. pasillo de distribución, toilette, cocina con comedor diario, jardín de invierno y patio con jardín y baulera. En planta Alta, 3 ambientes con placard empotrados, balcón corrido, lavadero, baño completo con ante baño, gran terraza con parrilla. Toda la casa está con un sistema de rejas que brinda una mayor seguridad. La totalidad de las aberturas poseen mosquiteros de excelente calidad, para mantener los ambientes aireados. Posee 3 split frío/calor. ",
        "El inmueble se encuentra en una muy buena zona, se destaca la buena distribución de los ambientes y su extrema luminosidad. Calle tranquila y silenciosa, con buena accesibilidad y cerca de establecimientos educativos. A 50 mts de Av Triunvirato y a 200 mts de av. Congreso."
