        "La estadía en esta casa invita a una AUTENTICA EXPERIENCIA RURAL. En una superficie de terreno total de 3 lotes equivalente a 11.100 m2, orientación norte a 50 mts de la cancha de polo con vista libre de 5 hectáreas sin vecinos cerca. Concebida para descansar en verano ya que la temporada alta de polo concluye a mediados de diciembre y se reanuda la temporada baja en febrero. ",
        "Si bien Santa Catalina es un club de Polo, sus socios son jugadores amateur, esto permite disfrutar de la practica en forma esporádica sin concurrencia masiva de espectadores. ",
        "Con una forestación de 100 años, en un total de 360 m2 construidos con amplio living, cocina a leña con comedor diario, 1 dormitorio en suite y otros dos dormitorios que comparten un baño, lavadero y dos cuartos en la torre cada uno con su baño. Galería de 4 m de ancho x 20 m de largo e inmenso jardín de invierno con mesa de ping pong, parrilla y bacha para lavar. Fresca en verano, la mayoría de las habitaciones se orientan al Este y cálida en invierno debido a su histórica construcción sobre un antiguo tambo en la que se se respetaron las paredes de 45 cm, asentada en barro con aberturas de cedro de demolición y vitraux con pisos de pinotea y techos de 4 mts de altura. En su conjunto, este antiguo casco rememora con exquisita ambientación las construcciones de antaño por su solidez en estructura, distribución y orientación sin que sea necesario incorporar infraestructura moderna como AA ya que el confort que se logra proviene de la tradición y las costumbres de otra época."
    ],
